import axios from "axios";
import React from "react";
import { useParams } from "react-router-dom";
const Study = ({ match }) => {
  const { id } = useParams();
  //   console.log(id);
  const getStudy = () => {
    axios.get(`http://localhost:3001/api/study/detail/${id}`);
  };
  return <div>스터디</div>;
};

export default Study;
